import React from 'react'
import PropTypes  from "prop-type"

export default function Navbar(props) {
    return (
        <div>
            <h3>{props.title}</h3>
            <hr />
        </div>
    )
}

Navbar.propType=
{
    title: PropTypes.string.isRequired
}
